import React from 'react';
import './menu.css';
import './Pesquisabar';

export default function Menu() {
  return (
 <>
<ul>
  <li><a className="active" href="#home">Inicio</a></li>
  <li><a href="#news">Noticias</a></li>
  <li><a href="#contact">Contatos</a></li>
  <li><a href="#about">Pesquisa</a></li>
</ul>

 </>
  );
}
